/*! jQuery Custom */
$(document).ready(function() {
	$(".slides").slick({
		dots: true,
		arrows: false,
		slidesToShow: 1,
		centerMode: true,
		variableWidth: true,
		/*autoplay: true,*/
		responsive: [
			{
				breakpoint: 1024,
				settings: {
					centerMode: false,
					variableWidth: false,
					
				}
			}
		]
	});
	
	if ($(window).width() > 736) {
		$(".scroll-x").mCustomScrollbar({
			axis: "x",
			callbacks:{
				onScrollStart: function() {
					var top = $("#gallery").offset().top;
					$("body, html").animate({scrollTop: top + 200}, "fast");
				},
			}
		});
	} else {
		$(".scroll-x").slick({
			dots: false,
			arrows: false,
			centerMode: true,
			infinite: false
		});
	}
});

$(".dropdown-toggle").on("click", function(e) {
	e.preventDefault();
	var dropdown = $(this).closest(".dropdown");
	
	// $(".dropdown-menu").slideUp();
	dropdown.find(".dropdown-menu").slideToggle();
});

$("body").click(function(e) {
    if ($(e.target).closest(".dropdown-toggle").length === 0) {
        $(".dropdown-menu").slideUp();
    }
});

$(window).on("scroll", function() {
	if ($("#categories").length) {
		var top = $(window).scrollTop();
		var offsetTop = $("#main").offset().top;
		
		if (top > offsetTop) {
			$("#categories").addClass("active");
		} else {
			$("#categories").removeClass("active");
		}
	}
});

$(window).on("scroll", function() {
	if ($(window).size() > 1024) {
		if ($(".parallax").length) {
			var top = $(window).scrollTop();
			var offsetTop = $("#restaurant").offset().top;
			var parallax = top - offsetTop;
			
			if (top > offsetTop) {
				if (parallax < 360) {
					$(".parallax").css({marginTop: -parallax});
					$(".parallax.top").css({marginTop: -(parallax + 206)});
				}
			}
		}
	}
});

$(".open").on("click", function(e) {
	e.preventDefault();
	var id = $(this).attr("href");
	
	$(".popup").fadeOut();
	$(id).fadeIn();
	$("body").css({overflow: "hidden"});
});
$(".overlay").on("click", function(e) {
	e.preventDefault();
	
	$(".popup").fadeOut();
	
	if ($(".view").is(":visible")) {
		$("body").css({overflow: "hidden"});
	} else {
		$("body").css({overflow: "visible"});
	}
});
$(".close").on("click", function(e) {
	e.preventDefault();
	
	$(".popup").fadeOut();
	
	if ($(".view").is(":visible")) {
		$("body").css({overflow: "hidden"});
	} else {
		$("body").css({overflow: "visible"});
	}
});

$(document).ready(function() {
	$.datetimepicker.setLocale('ru');
	var dateToday = new Date(); 
	
	$("#date").datetimepicker({
		i18n: {
			ru: {
				months: [
					'Январь','Февраль','Март','Апрель',
					'Май','Июнь','Июль','Август',
					'Сентябрь','Октябрь','Ноябрь','Декабрь',
				],
				dayOfWeek: [
					"S", "M", "T", "W", 
					"T", "F", "S",
				]
			}
		},
		timepicker: false,
		format: 'd.m.Y',
		parentID: '.date-container',
        minDate: dateToday
	});
	
	$("#time").datetimepicker({
		datepicker: false,
		format: 'H:i',
		allowTimes: [
			'10:00', '10:30', '11:00', '11:30', '12:00', '12:30', '13:00', '13:30', '14:00', 
			'14:30', '15:00', '15:30', '16:00', '16:30', '17:00', '17:30', '18:00', '18:30', 
			'19:00', '19:30', '20:00', '20:30', '21:00', '21:30', '22:00'
		],
		parentID: '.time-container'
	});
	
	$("#birth").datetimepicker({
		i18n: {
			ru: {
				months: [
					'Январь','Февраль','Март','Апрель',
					'Май','Июнь','Июль','Август',
					'Сентябрь','Октябрь','Ноябрь','Декабрь',
				],
				dayOfWeek: [
					"S", "M", "T", "W", 
					"T", "F", "S",
				]
			}
		},
		timepicker: false,
		format: 'd.m.Y',
		parentID: '.date-container'
	});
});

$(".nav a").on("click", function(e) {
	e.preventDefault();
	var id = $(this).attr("href");
	
	$(".nav a").removeClass("active");
	$(this).addClass("active");
	
	$(".tab").removeClass("active");
	$(".tab").hide();
	
	$(id).fadeIn();
});

$(".link button").one("click", function() {
	$("[name='copy']").focus();
	$("[name='copy']").select();
	document.execCommand("copy");
	$("[name='copy']").val("Промокод скопирован!");
});

$(".show").on("click", function() {
	$(this).toggleClass("hide");
	
	if ($(this).is(".hide")) {
		$(".password input").attr("type", "text");
	} else {
		$(".password input").attr("type", "password");
	}
});

$(".buy").on("click", function() {
	$(this).hide();
	$(this).closest(".product").find(".quantity").fadeIn()
});

$(".quantity button").on("click", function() {
	var input = $(this).closest(".product").find(".quantity input");
	var qty = parseInt(input.val());
	
	if ($(this).is(".minus")) {
		if (qty > 1) {
			qty = qty - 1;
		}
	} else {
		qty = qty + 1;
	}
	
	input.val(qty);
});

$("#checkout .radio input").on("change", function() {
	$(".type").hide();
	if ($(this).is(":checked")) {
		$(this).closest(".row").find(".type").fadeIn();
	}
});

$("#checkout .delivery select").on("change", function() {
	if ($("#totime").is(":selected")) {
		$("#checkout .checkout .time").fadeIn();
	} else {
		$("#checkout .checkout .time").hide();
	}
});

$("#menu .item .btn").on("click", function(e) {
	e.preventDefault();
	var id = $(this).attr("href");
	
	$(id).fadeIn();
	$("body").css({overflow: "hidden"});
});
$("#category .close").on("click", function() {
	$("#category").fadeOut();
	$("body").css({overflow: "visible"});
});

if ($("#range").length) {
	const _R = document.querySelector('[type=range]');
	_R.style.setProperty('--val', +_R.value);
	_R.style.setProperty('--max', +_R.max);
	_R.style.setProperty('--min', +_R.min);

	document.documentElement.classList.add('js');

	_R.addEventListener('input', e => {
		_R.style.setProperty('--val', +_R.value);
	}, false);

	$("[name='persons']").val($("#range").val());
}
$("#range").on("input", function() {
	$("[name='persons']").val($(this).val());
});

$(".burger").on("click", function() {
	$("body").css({overflow: "hidden"});
	$(".mobile-menu").addClass("active");
});
$(".mobile-menu .close").on("click", function() {
	$(".mobile-menu").removeClass("active");
	$("body").css({overflow: "visible"});
});